import React from "react"

import Maze from "./Maze"
import generateMaze from "./generateMaze"

import "./App.css"

const maze = generateMaze({width: 40, height: 40})

export default class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      width: '',
      height: ''
    }
  }


  render(){
    return (
    <div className="App">
      <Maze maze={maze} />
    </div>
    )
  }
}

